let message = msg;
message.guild.fetchBans()
  .then(banned => {
    let list = banned.map(user => user.tag).join('\n');

    if (list.length >= 1950) list = `${list.slice(0, 1948)}...`;

    message.channel.send(`**${banned.size} users are banned:**\n${list}`);
  })
  .catch(console.error);
